*
 * 获取客户端 ActionBar 的宽高信息
 *
 * @param {Object} [params] - 预留扩展
 *
 * @returns {Promise<{height: number, width: number}>} ActionBar 的宽高
 *
 * @example
 * libSQ.exec('get-action-bar-size').then((info) => {
 *  alert(`[get-action-bar-size][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[get-action-bar-size][error] ${JSON.stringify(err, null, 2)}`);
 * });

